using namespace std;

class Solution {
public:
    int minSpeedOnTime(vector<int>& dist, double hour) 
    {
        unsigned long long sum=accumulate(dist.begin(), dist.end(), 0);
        if(hour<dist.size()-1)
        {
            return -1;
        }
        for(int i=max((sum/(int)hour), (unsigned long long)1);i<=10000000;i++)
        {
            double total = 0;
            unsigned long long pre=0;
            for(int ti=0;ti<dist.size()-1;ti++)
            {
                pre += ((dist[ti]+i-1)/i);
                if(pre > hour)
                {
                    break;
                }
            }
            total = pre + dist.back()/(double)i;
            if(total <= hour)
            {
                return i;
            }

        }
        return -1;

    }
};

